export type PostData = {
  id: number;
  title: string;
  author: string;
  text: string;
};

const Post = ({postData}:{postData:PostData}): JSX.Element => {

  return (
    <div className="post">
     <p>Id:{postData.id}</p>
     <p>{postData.title}</p>
     <p>{postData.author}</p>
     <p>{postData.text}</p>
<button></button>
    </div>
  );
};

export default Post;
